arguments.schema:
{
  "type": "object",
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at"],
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier of the member"
    },
    "name": {
      "type": "string",
      "description": "Full name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Age of the member (must be between 20 and 100)"
    },
    "hobbies": {
      "type": "array",
      "items": {
        "type": "object",
        "required": ["id", "name"],
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier of the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        }
      },
      "description": "List of member's hobbies"
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Creation timestamp"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Last update timestamp"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "Soft deletion timestamp"
    }
  },
  "description": "Member information"
}

